from Crypto.Util.number import *

with open("flag.txt ", 'rb') as f:
    flag = f.read().strip()

assert flag.startswith(b'W1{') and flag.endswith(b'}')

m = bytes_to_long(flag)

e = 0x10001
m1 = 2**1024 - 3
m2 = 2**1022 - 2
m3 = 2**1020 - 1
m4 = 2**1018

c = pow(m, e, m1) % m2 % m3 % m4

print(c)
